import React, { Component } from 'react';
import {BootstrapTable, 
       TableHeaderColumn} from 'bootstrap-table';

 
 
class Table extends Component {
  render() {
    return (
      <div>
        <BootstrapTable data={this.props.data}>
          <TableHeaderColumn isKey dataField='investor_name'>
            Investor's name
          </TableHeaderColumn>
          <TableHeaderColumn dataField='commitment'>
            Investor's commitment
          </TableHeaderColumn>
          <TableHeaderColumn dataField='prior_contribution'>
          Investor's Prior Contribution
          </TableHeaderColumn>
          <TableHeaderColumn dataField='transfer_contribution'>
          Investor's Contribution to transfer
          </TableHeaderColumn>
          <TableHeaderColumn dataField='unfunded_commitment'>
          Investor's Unfunded Commitment
          </TableHeaderColumn>
          
        </BootstrapTable>
      </div>
    );
  }
}
 
export default Table;
